function fingerprint(str) {
  str = str.latinise();
  str = str.toLowerCase();
  str = str.replace(/\./g, '');
  return str;
}

function name_parse(namestring) {
  var person = {};

  var parts = namestring.match(/^(.*),\s+(Jr\.?)$/);
  if (parts) {
    namestring = parts[1];
    person.suffix = parts[2];
  }

  parts = namestring.match(/(.*),\s+(.*)/);
  if (parts) {
    person.familyName = parts[1];
    person.givenName = parts[2];
  }

  // clean up first name, e.g. initials
  if (person.givenName) {
    var matched = false;
    if (!matched) {
      parts = person.givenName.split(/\.\s*/);
      if (parts.length > 1) {
        matched = true;
	    person.givenName = parts.join(" ");
	    person.givenName = person.givenName.replace(/\s+$/, '');
      }
    }
    if (!matched) {
      if (person.givenName.match(/^[A-Z][A-Z]+$/)) {
        parts = person.givenName.split("");
        if (parts) {
          matched = true;
	      person.givenName = parts.join(" ");
	    }
	  }
    }
    
  }

  if (person.givenName) {
    person.givenName = person.givenName.replace(/\s\-/g, '-');
  }


  if (person.familyName) {
    person.name = person.givenName + ' ' + person.familyName;
  } else {
    person.name = namestring;
  }

  // generate standardise string to use as id
  person.fingerprint = fingerprint(person.name);

  return person;
}

// http://stackoverflow.com/a/21445415
function uniques(arr) {
  var a = [];
  for (var i = 0, l = arr.length; i < l; i++)
    if (a.indexOf(arr[i]) === -1 && arr[i] !== '')
      a.push(arr[i]);
  return a;
}

